import axios from "axios";

changeHandler = (e) => {
  const el = e.target;
  this.setState({
    [el.name]: el.type === "file" ? el.files[0] : el.value,
  });
};

submitBaner = (e) => {
  e.preventDefault();

  const bodyFormData = new FormData(e.target); // pass in the form

  axios.post("http://127.0.0.1:8000/detectar-objeto", bodyFormData);
};

export default function Imagen() {
  return (
    <div>
      <form onSubmit={this.submitBaner} onChange={this.changeHandler}>
        <div>
          <input type="file" name="img1" />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}
